  const response = await fetch("https://leetcode.com/graphql?query={%20matchedUser(username:%20%22tush27%22)%20{%20username%20submitStats:%20submitStatsGlobal%20{%20acSubmissionNum%20{%20difficulty%20count%20submissions%20}%20}%20}%20}",{
    // mode: "no-cors"
  });
  const jsonData = await response.json();
  console.log(jsonData);
}

function OverviewSection() {

  logJSONData();





